import React, {Component} from 'react';
import Feira from '../../components/Feira/Feira';

class Feiras extends Component {
    state = {
        feira: [
            {
                nome: "teste",
                local: "locali"
            }
        ]
    }

    
    componentDidMount() {
        console.log(this.state.feira[0]);
    }

    render(){
        const feira = this.state.feira[0];

        return(
            <div>
                <Feira feira={feira} nome={"meu teste"}></Feira>
                <Feira></Feira>
            </div>
        );
    };
}

export default Feiras;
